def largest_number(N, S):
    digits = [0] / N
    for i in range(N):
        if 9 <= S:
            digits[i] = 9
            S -= 9
        else:
            digits[i] = S
            S = 0
    if sum(digits) != S:
        return '-1'
    return ''.join(map(str, digits))

